import { createSlice } from "@reduxjs/toolkit";


initialState = {
    professionals: [],
}



const professionalsSlice = createSlice({

    name: 'professionals',
    initialState,
    reducers:{

        setProfessionals: (state,action) => {
            state.professionals = action.payload.professionals;
        }

    }
    


});

export const {setProfetionals} = professionalsSlice.actions;

export default professionalsSlice.reducer;
